import React from "react";
import '../styles/home.css';
import { Container,Row,Col } from "reactstrap";
import heroImg from 'frontend\src\assets/images/hero-img01.jpg';
import heroImg02 from '../assets/images/hero-img02.jpg';
import heroVideo from '../assets/images/hero-video.mp4';
import Subtitle from '../shared/Subtitle';
import WorldImg from '../assets/images/world.png';
const Home=()=>{
    return(
        <>
        {/*Hero section */}
        <section>
            <Container>
                <Row>
                    <Col lg='6'>
                    <div className="hero__content">
                        <div className="hero__subtitle d-flex align-items-center">
                            <Subtitle subtitle={'Know Before You Go'}/>
                            <img src={WorldImg} alt=""></img>
                        </div>
                        <h1>traveing opens the door to creating <span className="highlight">memories</span></h1>
                        <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Voluptates iure adipisci minus id consectetur, provident aut alias iste, vel 
                            aperiam voluptatem, cum praesentium atque assumenda inventore reprehenderit aliquid culpa! Illo?</p>
                    </div>
                    </Col>
                    <Col lg='2'>
                    <div className="hero__img-box">
                        <img scr={heroImg}></img></div>
                    </Col>
                    <Col lg='2'>
                    <div className="hero__img-box">
                        <video scr={heroVideo} controls></video></div>
                    </Col>
                    <Col lg='2'>
                    <div className="hero__img-box">
                        <img scr={heroImg02}></img></div>
                    </Col>
                </Row>
            </Container>
        </section>
        </>
    );
};
export default Home;
